import styled from 'styled-components'

export const FooterContainer = styled.footer`
  background-color: #3c3c3c;
  color: white;
  padding: 20px 0;

  width: 100%;
  display: flex;
  padding: 24px;
`

export const Lista = styled.ul`
  list-style-type: none;
  margin: 0;
  padding: 0;
`
